import React from "react";
import { logoLightText } from "../assets";

export const Footer = () => {
  return (
    <div className="bg-black text-[#949494] py-20 font-titleFont px-40">
      <div>
        <img src={logoLightText} className="w-60" alt="" />
        <input
          type="text"
          className="bg-transparent border-b border-b-gray-200"
        />
      </div>
    </div>
  );
};
